
<!DOCTYPE html>
<html>
<head>
    <title>Inkscape Output</title>
</head>
<body>
    <canvas id='canvas' width='80' height='80'></canvas>
    <script>
    var ctx = document.getElementById("canvas").getContext("2d");
    	
// #layer1
	
// #rect846
	ctx.beginPath();
	ctx.fillStyle = 'rgb(77, 77, 77)';
	ctx.lineWidth = 0.070004;
	ctx.rect(4.229860, 4.906638, 71.400032, 70.554070);
	ctx.fill();
	
// #rect892
	ctx.save();
	ctx.beginPath();
	ctx.transform(-1.000000, 0.000000, 0.000000, 1.000000, 0.000000, 0.000000);
	ctx.fillStyle = 'rgb(26, 26, 26)';
	ctx.lineWidth = 0.073359;
	ctx.rect(-38.842720, 38.439125, 19.755749, 3.150704);
	ctx.fill();
	ctx.restore();
	
// #path938
	ctx.beginPath();
	ctx.fillStyle = 'rgb(0, 0, 0)';
	ctx.lineWidth = 0.078311;
	ctx.arc(16.327257, 39.845280, 4.637148, 0.000000, 6.28318531, 1);
	ctx.fill();
	
// #rect1060
	ctx.beginPath();
	ctx.fillStyle = 'rgb(102, 102, 102)';
	ctx.lineWidth = 0.043134;
	ctx.rect(38.032604, 32.992908, 1.220501, 13.704746);
	ctx.fill();
	
// #rect1150
	ctx.beginPath();
	ctx.fillStyle = 'rgb(102, 102, 102)';
	ctx.strokeStyle = 'rgba(180, 35, 35, 0.533186)';
	ctx.lineWidth = 0.070004;
	ctx.rect(-8.290525, 129.095320, 0.676778, 0.338389);
	ctx.fill();
	ctx.stroke();

    </script>
</body>
</html>
